/*Table structure for table `leader` */

DROP TABLE IF EXISTS `leader`;

CREATE TABLE `leader` (
  `lid` int(5) NOT NULL AUTO_INCREMENT,
  `lname` varchar(50) DEFAULT NULL COMMENT '领导名字',
  `linfo` varchar(255) DEFAULT NULL COMMENT '领导职务',
  `did` int(6) DEFAULT NULL COMMENT '地区id',
  `o_id` int(5) DEFAULT NULL COMMENT '所属机构id',
  `phone` varchar(50) DEFAULT NULL COMMENT '电话号码',
  `content` text COMMENT '内容',
  `description` varchar(255) DEFAULT NULL COMMENT '摘要',
  `picture` tinyblob COMMENT '图片',
  `ctime` int(10) DEFAULT NULL COMMENT '创建时间',
  `mtime` int(10) DEFAULT NULL COMMENT '修改时间',
  `state` int(1) DEFAULT NULL COMMENT '状态(0下岗，1在职)',
  PRIMARY KEY (`lid`)
) ENGINE=InnoDB AUTO_INCREMENT=3917 DEFAULT CHARSET=utf8 COMMENT='领导人信息';

